import {BrowserRouter, Switch, Route} from "react-router-dom";
//ページのインポート
import Login from "./Login";
import Signup from "./Signup";
import Room from "./Room";

const App = () => {
    return (
        <Fragment>
            <Switch>


            <Route exact path= "./">
                <Login />
            </Route>
            <Signup />
            <Room />
            </Switch>
        </Fragment>
    );
};
export default App;
